    public static String convierteFormato(String curpIngresada) {
        String CURPconvertida = curpIngresada.toUpperCase();
        return CURPconvertida;
    }

    public static boolean validarFormato(String curpIngresada) {
        Pattern exlangformato = Pattern.compile("^([A-Z][AEIOUX][A-Z]{2}\\d{2}(?:0[1-9]|1[0-2])(?:0[1-9]|[12]\\d|3[01])[HM](?:AS|B[CS]|C[CLMSH]|D[FG]|G[TR]|HG|JC|M[CNS]|N[ETL]|OC|PL|Q[TR]|S[PLR]|T[CSL]|VZ|YN|ZS)[B-DF-HJ-NP-TV-Z]{3}[A-Z\\d])(\\d)$");
        Matcher comparacion = exlangformato.matcher(convierteFormato(curpIngresada));
        Boolean valida = comparacion.find();
        return valida;
    }

    public static String ultimoDigitocurp(String curpIngresada) {
        String ultimoDigito = String.valueOf(convierteFormato(curpIngresada).charAt(convierteFormato(curpIngresada).length() - 1));
        return ultimoDigito;
    }

    public static String digitoVerificador(String curpIngresada) {
        String diccionario = "0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZ";
        Double lngSuma = 0.0;
        Double lngDigito = 0.0;
        if (validarFormato(convierteFormato(curpIngresada))) {
            for (int i = 0; i < 17; i++) {
                lngSuma = lngSuma + diccionario.indexOf(convierteFormato(curpIngresada).charAt(i)) * (18 - i);
            }
        }
        lngDigito = 10 - lngSuma % 10;
        if (lngDigito == 10) {
            lngDigito = 0.0;
        }
        Integer convetidoInteger = lngDigito.intValue();
        String convertidoString = String.valueOf(convetidoInteger);
        return convertidoString;
    }

    public static Boolean validaCurp(String curpIngresada) {
        Boolean valor = false;
        if (validarFormato(curpIngresada)) {
            if (digitoVerificador(curpIngresada).equals(ultimoDigitocurp(curpIngresada))) {
                valor = true;
            }
        }
        return valor;
    }
